function tagSelection(){

    var tagList, selectedList, addCustomTagBtn;

    tagList = $('#select-tag-list');
    addCustomTagBtn = $('#add-new-tag');
    userTagsInput = $('#user_tag_list');
    submitBtn = $('#submit-user-tags');

    if (tagList.length != 1) return;

    selectedList = usertags.split(',').map(function(item) {
                      return item.trim();
                    });

    tagList.on( "click", "li", getVal);
    addCustomTagBtn.on( "click", createNewTag);
    selectMyTags();

    function getVal(e){
        var el = $(e.currentTarget);
        var tag = el.text().trim();
        console.log(tag)
        el.toggleClass('active');
        addToList(selectedList, tag);
    }   

    function addToList(a, v) {
        var i = a.indexOf(v);
        if (i === -1)
            a.push(v);
        else
            a.splice(i,1);

        insertIntoInput();
    }

    function createNewTag(){
        var customTag = $('#custom-tag-input');
        var newTag = customTag.val().trim();
        if (newTag.length < 20 && newTag.length > 0){
            tagList.append('<li class="tag-bubble insert"><span>'+ newTag +'</span></li>');
            customTag.val("");
        }else{
            alert('A tag can only contains less then 20char');
        }
    }

    function insertIntoInput(){
        userTagsInput.val(selectedList);
        if (selectedList.length >= 3){
            submitBtn.addClass('anim-next');
        }
    }
    
    function selectMyTags() {

        tagList.find('li').filter(function( index, el ) {
            var el = $(el);
            var text = el.text().trim();
            //console.log(text)
            $.each(selectedList, function(i,v){
                console.log(v)
                if (text == v) {
                    el.addClass('active');
                }
            });
        });
    }

}

function initTagSelection() {
    var tagList,input,submit,userTagList, btnAdd;

    tagList = $('#select-tag-list');
    btnAdd = $('#add-new-tag');
    if (tagList.length == 0) return;
    
    tagList.on( "click", "li:not('.insert')", storeValue);
    // tagList.on( "click", "button", addBubble);
    // tagList.on("keyup", "#new-tag-value", setBubble);


    input = $('#user_tag_list');
    submit = $('#btn-add-tag');
    
    userTagList = usertags.replace(/\s/g, '').split(',');

    init();
    validate(userTagList);

    function init() {

        tagList.find('li').filter(function( index, el ) {
            var el = $(el);
            var text = el.text().replace(/\s/g, '');
            $.each(userTagList, function(i,v){
                if (text == v) {
                    el.addClass('active');
                }
            });
        });
    }

    function storeValue(e) {
        var el = $(e.currentTarget);
        var tag = el.text().replace(/\s/g, '');
        el.toggleClass('active');
            toggleArrayItem(userTagList, tag);
            setValueInput(userTagList);
            validate(userTagList)
    }

    function toggleArrayItem(a, v) {
        var i = a.indexOf(v);
        if (i === -1)
            a.push(v);
        else
            a.splice(i,1);
    }

    function setValueInput(v) {
        input.val(v);
    }

    function validate(v) {
        if(userTagList.length > 3 ){
            submit.addClass('anim-next');
        }
        if(userTagList.length < 3 ){
            submit.removeClass('anim-next');
        }
    }

    function addBubble(e) {
        e.preventDefault();
        tagList.prepend('<li class="tag-bubble insert"><textarea id="new-tag-value"></textarea></li>');
    }
    function setBubble(e){
        if(e.keyCode == 13)
        {
           var el = $(e.currentTarget).parent();
           var value = $(e.currentTarget).val().replace(/\s+/g, '');
            el.append('<span>'+value+'</span>');
            $(e.currentTarget).remove();
            el.toggleClass('insert');
            el.toggleClass('active');
        }
    }
}

